volveran a comunicarse\r\ntengo registrada a melida tambien con esta telefono ella ablo tambien de este telefon.'),(15,'Doña Maria','Plutarco Elias CAlles.','7-61-12-16',3,'','22/02/2011','05/01/2012','Esta peresona le interesa esta casa pero tiene unicamente 250,000 vera si puede consegurir 350,000 y se volvera a comunicar para hacer una oferta ofrecer tambien plutarco elias calles'),(16,'Felipe de Jesus Arellano ','Barrancos','2-48-58-76',3,'','22/02/2011','16/03/2011','Quiere comprar de contado , con el producto de un credito de fovissste que consiguio autoventa de su mama  y con el producto quiere comprar coprara casa se le dio la de plutarco pero no le alcanza se le dieron mas, villa bonita,  que las vea y si le gusta se comunicara,  solidariedad, ver que paso.ya   compro \r\nmar-16-11 ya compro'),(17,'Juan Ambrocio Diaz Carrillo y Hector Diaz','mision de sonoma 2607 capistrano residencial ','7-12-59-01 y hector cel. 71 01 01 28',3,'','22/02/2011','28/03/2011','28 Mar-11\r\nhoy llego la autorizacion para vendersela para que deposito al infonavit.\r\nAcudio Hector Diaz Carrillo acudio en representacion de su hermano  para apartar una casa ubicada en sonoma 2607 con 3,000. para el avaluo,  dependiendo lo que resulte del avaluo decidira si la compra de contado, para su hermano Juan Ambrocio. se le debe de explicar que no la podra vender en un aÃ±o asi diran las escrituras. '),(20,'Roman Gonzalez','Altamira ','',4,'http://www.enviageb.com.mx/','23/02/2011','02/03/2011',' que le mandes 3 copias de ..Credencial de elector Tarjeta del seguro Social Cartilla Militar Curp Comprobante de domicilio.3 cartas poder  original de la papeleria firmadas donde dice otorgante, a nombre de carmen ocurre por paqueterÃ­a estrella blanca, y avisarle.Comunicarme a san bernardo para ver'),(22,'Rafael Fajardo  ','','Trab... 4-55-56-30 ',2,'','24/02/2011','01/03/2011','Que le interesa una casa de colonia con cred. bancario hasta 320,000. ya esta autorizado le intereso la casa de doÃ±a lo